// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CeeLow {
    uint8 public activePlayers;
    uint8 public numPlayers;
    uint8 public currentPlayerId;
    uint8 public turn;
    uint8 public firstRoll;
    uint8 constant MAX_PLAYERS = 5;
    uint8 constant MIN_PLAYERS = 2;
    uint8 constant MAX_OVERALL_SCORE = 14;
    uint constant BET_SIZE = 100;
    uint betPool;
    uint8 round = 1;
    uint8 currentHighScore = 1;

    struct Player{
        address payable addr;
        uint8[4][] score;
        uint8 currentScore;
        uint balance;
        uint betThisRound;
        bool inGame;
        uint8 playerId;
        bool isTurn;
        bool isFirstRoll;
        bool isWaitForBet;
        bool isWaitForCall;
        bool hasRolled;
    }
    Player[] players;
    uint8[] winners;
    // stage of match 0 = between game, 1 = wait for first bet, 2 = wait for calls, 3 = in round, 4 = between rounds 
    uint8 public stageOfMatch = 0; 

    event Turn(uint8 turn);
    event Players(Player[] players);
    event Winners(uint8[] winners);
    event ContractBalance(uint balance);
    event StageOfMatch(uint8 stageOfMatch);
    event BetPool(uint betPool);
    event Rolls(uint8[3][25] rolls, uint8 r1, uint8 r2, uint8 r3);
    event Scores(uint8 playerId, uint8 s1, uint8 s2, uint8 s3, uint8 currentScore);
    event Round(uint8 round);
    event HighScore(uint8 currentHighScore);
    event AllRolled(bool allRolled);

    function startRound() external{
        //require(numPlayers > MIN_PLAYERS, "more players are needed");
        //require(playerNum == firstRoll, "player who has the first turn must act");
        //require(stageOfMatch == 0, "must be between matches to start a match");
        //takeBets();
        stageOfMatch = 1;

        players[firstRoll].isTurn = true;
        players[firstRoll].isFirstRoll = true;
        players[firstRoll].isWaitForBet = true;
        emit Turn(turn);
        emit Players(players);
        emit StageOfMatch(stageOfMatch);
        //emit BetSizes(bets);
    }

    function takeFirstBet(uint betSize) external {
        //require(players[firstRoll].balance >= betSize, "player balance does not cover bet size");
        players[firstRoll].balance -= betSize;
        betPool = betSize;
        players[firstRoll].betThisRound = betSize;
        stageOfMatch = 2;
        players[firstRoll].isWaitForBet = false;

        for(uint8 i = 0; i < numPlayers; i++){
            if(i != firstRoll){
                players[i].isWaitForCall = true;
            }
        }

        emit Turn(turn);
        emit Players(players);
        emit StageOfMatch(stageOfMatch);
        //emit BetSizes(bets); 
    }

    function callBet(uint8 playerIndex, uint betSize) external {
        //require(players[playerIndex].balance >= betSize, "player balance does not cover bet size");
        players[playerIndex].balance -= betSize;
        players[playerIndex].betThisRound = betSize;
        players[playerIndex].isWaitForCall = false;
        betPool += betSize;

        bool allCallsIn = true;
        for(uint8 i = 0; i < numPlayers; i++){
            if(players[i].isWaitForCall == true){
                allCallsIn = false;
            }
        }
        if(allCallsIn == true){
            stageOfMatch = 3;
        }
        emit Players(players);
        emit StageOfMatch(stageOfMatch);
        emit BetPool(betPool);
    }

    function simulateRolls(uint8[3][25] memory rolls) internal returns(uint8[4] memory) {
        bool isValidRoll;
        uint8 i;
        uint8 overallScore;

        emit Rolls(rolls, rolls[0][0], rolls[0][1], rolls[0][2]);
        uint8[3] memory dieRolls;
        while(!isValidRoll && i < 25){
            dieRolls[0] = rolls[i][0];
            dieRolls[1] = rolls[i][1];
            dieRolls[2] = rolls[i][2];
            overallScore = calculateOverallScore(dieRolls);

            if(overallScore != 0) isValidRoll = true;
            else i++;
        }
        return [rolls[i][0], rolls[i][1], rolls[i][2], overallScore];
    }

    function checkAllRolled() view internal returns (bool){
        for(uint8 i = 0; i < numPlayers; i++){
            if(!players[i].hasRolled) return false;
        }
        return true;
    }

    function checkHighScore() internal{
        for(uint8 i = 0; i < numPlayers; i++){
            if(players[i].currentScore > currentHighScore){
                currentHighScore = players[i].currentScore;
            }
        }
        emit HighScore(currentHighScore);
    }

    function findWinners() internal{
        for(uint8 i = 0; i < players.length; i++){

            if(players[i].currentScore >= currentHighScore){
                winners.push(players[i].playerId);
                players[i].inGame == true;
                currentHighScore = players[i].currentScore;
            }
            else{
                players[i].inGame == false;
            }
        }
    }

    function calculateOverallScore(uint8[3] memory scores) pure internal returns(uint8 score){
        uint8 die1 = scores[0];
        uint8 die2 = scores[1];
        uint8 die3 = scores[2];

        if(die1 == die2 && die2 == die3) return threeMatch(die1);

        else if(die1 == die2) return twoMatch(die3);

        else if (die1 == die3) return twoMatch(die2);

        else if(die2 == die3) return twoMatch(die1);

        else if(die1 + die2 + die3 == 15) return 14;

        else if(die1 + die2 + die3 == 6) return 1;

        else return 0;
    }

    function twoMatch(uint8 notMatch) pure internal returns(uint8 score){
        if(notMatch == 1){
            return 2;
        }
        else if(notMatch == 2){
            return 3; 
        }
        else if(notMatch == 3){
            return 4; 
        }
        else if(notMatch == 4){
            return 5; 
        }
        else if(notMatch == 5){
            return 6; 
        }
        else if(notMatch == 6){
            return 7; 
        }
        return 0;
    }

    function threeMatch(uint8 isMatch) pure internal returns(uint8 score){
        if(isMatch == 1){
            return 8;
        }
        else if(isMatch == 2){
            return 9; 
        }
        else if(isMatch == 3){
            return 10; 
        }
        else if(isMatch == 4){
            return 11; 
        }
        else if(isMatch == 5){
            return 12; 
        }
        else if(isMatch == 6){
            return 13; 
        }
        return 0;
    }

    function getBalance() internal view returns (uint){
        return address(this).balance;
    }

    modifier playerNotInGame(address payable _player_addr){
        for(uint8 i = 0; i < numPlayers; i++){
            require(players[i].addr != _player_addr, "player already in game");
        }
        _;
    } 

    function withdrawPlayer(uint8 index) external {
        //require(stageOfMatch == 0, "players can only withdraw between games");
        //require(index < players.length, "Player ID does not exist");

        if(players[index].balance > 0){
            payable(address(players[index].addr)).transfer(players[index].balance);
        }

        if(index == firstRoll){
            moveFirstRoll();
        }

        removePlayer(index);
        numPlayers--;
        emit Players(players);
        emit ContractBalance(getBalance());
    }

    function removePlayer(uint8 index) internal{
        if (index >= players.length) return;

        for (uint8 i = index; i < players.length-1; i++){
            players[i] = players[i+1];
        }
        players.pop();
    }

    function addPlayer(address payable _playerAddr, uint _balance) public payable /*playerNotInGame(_player_addr)*/ {
        //require(numPlayers <= MAX_PLAYERS, "game is full");
        //require(stageOfMatch == 0, "players can only join between games");
        uint8[4][] memory tempScore;
        Player memory newPlayer = Player({
                                            score: tempScore,
                                            currentScore: 0, 
                                            balance: _balance, 
                                            betThisRound: 0, 
                                            addr: _playerAddr, 
                                            inGame: true, 
                                            playerId: currentPlayerId, 
                                            isTurn: false, 
                                            isFirstRoll: false, 
                                            isWaitForBet: false,
                                            isWaitForCall: false,
                                            hasRolled: false
                                        });
        players.push(newPlayer);
        numPlayers++;
        currentPlayerId++;
        emit Players(players);
        emit ContractBalance(getBalance());
    }

    function clearWinners() internal{
        while(winners.length > 0){
           winners.pop();
        }
    }

    function endMatch() internal{
        players[winners[0]].balance += betPool;
        round = 1;
        stageOfMatch = 0;
        currentHighScore = 1;

        firstRoll++;
        if(firstRoll >= numPlayers){
            firstRoll = 0;
        }
        turn = firstRoll;

        resetPlayersForNewMatch();
    }

    function resetRound() internal{
        round++;
        stageOfMatch = 2;
        currentHighScore = 1;
        resetPlayersForNewRound();
    }

    function resetPlayersForNewMatch() internal{
        uint8[4][] memory tempScore;
        for(uint8 i = 0; i < players.length; i++){
            players[i].score = tempScore;
            players[i].currentScore = 0; 
            //balance: _balance, 
            players[i].betThisRound = 0; 
            //addr: _playerAddr, 
            players[i].inGame = true; 
            //playerId: currentPlayerId, 
            if(i == firstRoll){
                players[i].isTurn = true; 
                players[i].isFirstRoll = true; 
            }
            else{
                players[i].isTurn = false; 
                players[i].isFirstRoll = false; 
            }
            players[i].isWaitForBet = false;
            players[i].isWaitForCall = false;
            players[i].hasRolled = false;
        }
    }

    function resetPlayersForNewRound() internal {
        uint8[4][] memory tempScore;
        for(uint8 i = 0; i < players.length; i++){
            players[i].score = tempScore;
            players[i].currentScore = 0; 
            //balance: _balance, 
            players[i].betThisRound = 0; 
            //addr: _playerAddr, 
            players[i].inGame = true; 
            //playerId: currentPlayerId, 
            if(i == firstRoll){
                players[i].isTurn = true; 
                players[i].isFirstRoll = true; 
            }
            else{
                players[i].isTurn = false; 
                players[i].isFirstRoll = false; 
            } 
            players[i].isWaitForBet = false;
            players[i].isWaitForCall = true;
            players[i].hasRolled = false;
        }
    }

    function moveFirstRoll()internal {
        firstRoll++;
        if(firstRoll >= numPlayers){
            firstRoll = 0;
        }
    }

    function resetGame() external{

        while(numPlayers > 0){
            uint8 index = numPlayers - 1;
            payable(address(players[index].addr)).transfer(players[index].balance + players[index].betThisRound);
            numPlayers--;
            players.pop();
        }

        clearWinners();
        currentPlayerId = 0;
        betPool = 0;
        turn = 0;
        firstRoll = 0;
        stageOfMatch = 0;
        betPool = 0;
        round = 1;
        currentHighScore = 1;
        emit Players(players);
    }

    function addToBalance(uint8 index) external payable {
        //require(index < numPlayers, "player not in game");
        uint balance = players[index].balance;
        players[index].balance = balance + msg.value;
        emit Players(players);
        emit ContractBalance(getBalance());
    }

    function roll(uint8 playerIndex, uint8[3][25] memory rolls) external{
        //require(stageOfMatch == 3, "must be in a match to roll");
        //require(playerIndex == turn, "it is not your turn");

        //simulate random dice roll
        //replace with chainlink when ready for testnet
        uint8[4] memory scores = simulateRolls(rolls);
        players[turn].score.push(scores);
        players[turn].currentScore = scores[3];
        players[turn].isTurn = false;
        players[turn].hasRolled = true;
        turn++;
        if(turn >= numPlayers){
            turn = 0;
        }
        players[turn].isTurn = true;

        checkHighScore();
        clearWinners();
        findWinners();
        emit Scores(turn, scores[0], scores[1], scores[2], scores[3]);
        emit Winners(winners);
        //emit HighScore(currentHighScore); see checkHighScore()
        //emit Winners(winners); see findWinners()
        bool allRolled = checkAllRolled();
        emit AllRolled(allRolled);
        if(allRolled){
            stageOfMatch = 4;
            currentHighScore = 0;

            if(winners.length > 1){
                //new round needed
                resetRound();
            }
            else if (winners.length == 1){
                //declare winner
                endMatch();
            }

        }
        emit Players(players);
        emit Round(round);
        emit StageOfMatch(stageOfMatch);
        emit Turn(turn);
    }
}
